export default App;

function Items({prod, count, setcount}) {
    const [show, setShow] = useState(false)
   
    function addcart(){
      setcount(count+1)
      setShow(!show)
    }
    function removecart(){
      setcount(count-1)
      setShow(!show)
    }
  return (
    <div>
      <Card style={{ width: '18rem' }}>
      <Card.Img  variant="top" src={prod.productimage}/>
      <Card.Body>
        <Card.Title className='kr'>{prod.productname}</Card.Title>
        <Card.Text>{prod.productrating}</Card.Text>
        <Card.Text>{prod.productprice}</Card.Text>
        {!show ? 
        <Button variant="warning"
        onClick={addcart}
        >Add to Cart</Button>
        : ""}
        { show ?
        <Button variant="danger" 
        onClick={removecart}
        >Remove from Cart</Button>
        : ""}
      </Card.Body>
    </Card>
    </div>
  )
}